import "./Supermarket.css";
import {FaClipboardList} from "react-icons/fa"

const Supermarket = () => {
  return (
    <div className="backgroundSuper">
      <div className="bannerSuper" id="landing">
        Supermarket
      </div>
      <div>
        <div className="mapImage">
          {/* <a href="https://goo.gl/maps/9vRLjczTEsrK8Gcn7" rel="noreferrer" target="_blank"> </a>  Use it with image*/}
          {/* <img src="" alt="" />
          <img src="" alt="" /> */}
        </div>
        <div className="mapLink">
          <p className="linkText">https://goo.gl/maps/9vRLjczTEsrK8Gcn7</p>
          <button className="copyButton"><FaClipboardList size={30}></FaClipboardList></button>
        </div>
      </div>
    </div>
  );
};

export default Supermarket;
